import React from 'react'
import NumbersTableCell from './numbersTableCell'
import PaymentsTable from './paymentsTable'
import RepaymentsTable from './repaymentsTable'
import SeasonalTrendsTable from './seasonalTrendsTable'

const BiztoolCell = (props) => {

  return (
    <div>
      {props.type == 'text' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'money' &&
        <input
          type='money'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'number' &&
        <input
          type='number'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'date' &&
        <input
          type='date'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}

      {props.type == 'payments-table' &&
        <PaymentsTable
          data={props.data}
          colIndex={props.colIndex}
          tableType={props.type}
          onCellChange={props.onCellChange}
          address={props.address}
          width={props.width}
        />}

    </div>
  )
}

export default BiztoolCell
